    [],nt"revision_timestamp": "2015-09-26T22:29:19.427833",nt"name": "hawaii-dar-dealer-reporting-system-data",nt"isopen":
    false,nt"url": null,nt"notes": "In 2000 January, the Hawaii Division of
    Aquatic Resources (DAR) implemented a computerized data processing system for fish
    dealer data collected state-wide. Hawaii law requires that all fish dealers must
    provide a report to DAR for all purchases made directly from fishers. The term "fish
    dealers" includes fish auctions, fish markets, stores, restaurants, or any business
    buying fish directly from fishermen, and even fishermen themselves if they peddle
    their own fish. Some dealers provide data electronically, but most still submit
    paper forms supplied by DAR.",nt"license_title": null,nt"extras": [{ntt"key":
